import React, { useState } from "react";
import { Modal, Button, Form, Input, InputNumber, message } from "antd";

export default function Page1() {
  const [isLoad, setIsLoad] = useState(false);
  const [form] = Form.useForm();
  const onFinish = async (value) => {
    setIsLoad(false);
    message.success("Sign in success!");
  };
  return (
    <Form
      form={form}
      onFinish={onFinish}
      // onFinishFailed={onFinishFailed}
      wrapperCol={{ span: 30 }}
      layout="horizontal"
    >
      <Form.Item
        name="Full Name"
        label="Full Name"
        rules={[
          {
            required: true,
          },
        ]}
      >
        <Input />
      </Form.Item>
      <Form.Item
        name="UserName"
        label="UserName"
        rules={[
          {
            required: true,
          },
        ]}
      >
        <Input />
      </Form.Item>
      <Form.Item
        name="password"
        label="Password"
        rules={[
          {
            required: true,
            message: "Please input your password!",
          },
        ]}
        hasFeedback
      >
        <Input.Password />
      </Form.Item>
      <Form.Item
        name="Email"
        label="Email"
        rules={[
          {
            type: "email",
          },
        ]}
      >
        <Input />
      </Form.Item>
      <Form.Item
        name="Age"
        label="Age"
        rules={[
          {
            type: "number",
            min: 13,
            max: 120,
          },
        ]}
      >
        <InputNumber />
      </Form.Item>
      <Form.Item name="website" label="Website">
        <Input />
      </Form.Item>
      <Form.Item name="Feeling" label="Feeling">
        <Input.TextArea />
      </Form.Item>
      <Form.Item>
        <Button
          onClick={() => setIsLoad(!isLoad)}
          loading={isLoad}
          type="primary"
          htmlType="submit"
        >
          Submit
        </Button>
      </Form.Item>
    </Form>
  );
}
